  const { leftMenuIsOpened, setLeftMenuIsOpened } = useState(true)

  console.log('props----',props,'leftMenuIsOpened:',leftMenuIsOpened)

  return(
    <HeaderWithSwipeableMenu
      title={props.title}
      leftMenuIsOpened={true}
